pragma solidity ^0.8.10;
import "./Token.sol";

contract Bank {
    //assign Token contract to variable
    Token private token;
    // hash address - uint
    mapping(address => uint) public clientsBalanceBNB;
    mapping(address => uint) public depositTimeStamp;
    mapping(address => bool) public isDeposited;
    mapping(address => uint) public clientsInterests;
    mapping(address => uint) public clientsBalanceBNB2;
    mapping(address => uint) public depositTimeStamp2;
    mapping(address => bool) public isDeposited2;
    mapping(address => uint) public clientsInterests2;
    uint public totalBNBFromTokenSales = 0;
    
    //pass as constructor argument deployed Token contract
    constructor(Token _token) public {
        //assign token deployed contract to variable
        token = _token;
    }     

    function deposit() payable public {
        // interest so far
        uint interest = calculateInterest(msg.sender);
        clientsInterests[msg.sender] += interest; 

        // reset
        clientsBalanceBNB[msg.sender] += msg.value;
        depositTimeStamp[msg.sender] = block.timestamp;
        isDeposited[msg.sender] = true; 
    }  

    function withdraw() payable public {
        require(isDeposited[msg.sender] == true, 'Error, no previous deposit');
        require(msg.value >= 0.05 ether, 'Error, insufficient withdrawal fee');

        // interest BMIW
        uint interest = calculateInterest(msg.sender);
        clientsInterests[msg.sender] += interest;

        // return the BNB to original wallet
        payable(msg.sender).transfer(clientsBalanceBNB[msg.sender] - 0.008 ether);
        clientsBalanceBNB[msg.sender] = 0;

        // Crear el token y lo envia a la addres del msg.sender
        token.mint(msg.sender, interest);
        // reiniciar reposito
        depositTimeStamp[msg.sender] = 0;
        isDeposited[msg.sender] = false;
    }

    function calculateInterest(address account) internal returns (uint) {
        uint depositTotalTime = block.timestamp - depositTimeStamp[account];
        uint interestPerSecond = (100 * clientsBalanceBNB[account]) / 31668017;
        uint interest = interestPerSecond * depositTotalTime;
        return interest;
    }

    function getClientBalanceBNB(address client) public view returns (uint) {
        return clientsBalanceBNB[client];
    }

    function getClientInterest(address client) public view returns (uint) {
        return clientsInterests[client];
    }

    function secondDeposit() payable public {
        // interest so far
        uint interest = calculateInterest2(msg.sender);
        clientsInterests2[msg.sender] += interest; 

        // reset
        clientsBalanceBNB2[msg.sender] += msg.value;
        depositTimeStamp2[msg.sender] = block.timestamp;
        isDeposited2[msg.sender] = true;
    } 

    function secondWithdraw() payable public {
        require(isDeposited2[msg.sender] == true, 'Error, no previous deposit');
        require(msg.value >= 0.05 ether, 'Error, insufficient withdrawal fee');
        require(block.timestamp >= (depositTimeStamp2[msg.sender] + 600), 'Error, withdrawal is locked');

        // interest BMIW
        uint interest = calculateInterest2(msg.sender);
        clientsInterests2[msg.sender] += interest;

        // return the BNB to original wallet
        payable(msg.sender).transfer(clientsBalanceBNB2[msg.sender] - 0.008 ether);
        clientsBalanceBNB2[msg.sender] = 0;

        // Crear el token y lo envia a la addres del msg.sender
        token.mint(msg.sender, interest);
        // reiniciar reposito
        depositTimeStamp2[msg.sender] = 0;
        isDeposited2[msg.sender] = false;
    }

    function getClientBalanceBNB2(address client) public view returns (uint) {
        return clientsBalanceBNB2[client];
    }

    function getClientInterest2(address client) public view returns (uint) {
        return clientsInterests2[client];
    }

    function calculateInterest2(address account) internal returns (uint) {
        uint depositTotalTime = block.timestamp - depositTimeStamp2[account];
        uint interestPerSecond = (100 * clientsBalanceBNB2[account]) / 31668017;
        uint interest = 2 * interestPerSecond * depositTotalTime;
        return interest;
    }

    function buyTokens(uint tokensToBuy) public payable {
        uint requiredBNB = tokensToBuy * 0.001 ether;        
        require(msg.value >= requiredBNB, 'Error, insufficient BNB');

        // Transfer the tokens to the buyer
        token.transfer(msg.sender, tokensToBuy);

        totalBNBFromTokenSales += msg.value;
    }

    function getTotalBNBFromTokenSales() public view returns (uint) {
        return totalBNBFromTokenSales;
    }
}
